PFG/Interest.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity^0.8.15;

contract Interest {


    uint256 public rate;
    uint256 private dec;
    bool private executed;



    constructor(uint256 _init){
        dec = 18;
        rate = _init * 10 ** dec;
        executed = false;
    }

    function collInterest(uint256 val, uint256 col) public {
        require(!executed, "Already executed");
        uint256 valueDec = (val * 10 ** dec);
        uint256 colDec = (col * 10 ** dec);
        uint256 actualRef = valueDec/col;
        uint256 ref = 1250000000000000000;

        if (ref <= actualRef){
            rate -= ref-actualRef;
        }
        else{
            uint256 x = (rate*125) / (val*100);
            uint256 colRes = (valueDec * 80)/100;
            uint256 difCol = colDec - colRes;
            uint256 res = (x * difCol)/(10**dec);
            rate -= res;
        }

        executed = true;
    }

    function reduction() public {
        rate = (rate * 7) /8;
    }








}

